import axios from 'axios'

function callAPI() {
    const actions = {
        async get() {
            try {
                const { data } = await axios.get(`http://192.168.1.12:9000/class/get${this.props.match.url}`)
                return data
            } catch (error) {
                return error.response
            }
        }
    }
    return actions
}

export default callAPI
